INSERT INTO `wp_comments` VALUES("4", "291", "Ольга", "mail@mail.ru", "", "127.0.0.1", "2017-06-13 08:18:58", "2017-06-13 05:18:58", "Значимость этих проблем настолько очевидна, что консультация с широким активом играет важную роль в формировании новых предложений. С другой стороны постоянное информационно-пропагандистское обеспечение нашей деятельности обеспечивает широкому кругу (специалистов) участие в формировании позиций, занимаемых участниками в отношении поставленных задач.", "0", "1", "Mozilla/5.0 (Windows NT 5.1; rv:52.0) Gecko/20100101 Firefox/52.0", "", "0", "0");
